import React, {Component} from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import ContactForm from './ContactForm';

import '../Styles/Contact.css';
import Jumbotron from 'react-bootstrap/Jumbotron';


const Contact = () => (


<Container fluid id="contact">

<Jumbotron className="contactJumbo" fluid>
<link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Rubik:500|Open+Sans|Rancho|Nunito|Permanent+Marker&display=swap" rel="stylesheet"></link>
<Container>
    <h1 className="contactTitle">Contact Me</h1>
    <Row>
        <Col lg={12}>
            <p className="contactContent">

            </p>
        </Col>
    </Row>
</Container>

</Jumbotron>

</Container>
//    <Container className="contactBox">
//        <link href="https://fonts.googleapis.com/css?family=Fredericka+the+Great|Lateef|Open+Sans|Rancho|Permanent+Marker&display=swap" rel="stylesheet"></link>
//        <ContactForm/>
//    </Container>
)

export default Contact;
